import React, { useState } from "react";

function App() {
  const [count, setCount] = useState(0);

  const increment = () => {
    setCount(count + 1);
  };

  const decrement = () => {
    setCount(count - 1);
  };

  const iincrement = () => {
    setCount(count + 2);
  };




  return (
    <div>
      <button onClick={increment}>+</button> 
      <span>{count}</span> 
      <button onClick={decrement}>-</button>

      <button onClick={iincrement}>+</button> 
      <span>{count}</span> 
      <button onClick={decrement}>-</button>

    </div>
  );
}

export default App;
